import React from 'react'
import './Feed.css'
import CreateIcon from '@mui/icons-material/Create';

const Feed = () => {
  return (
    <div className='feed'>
        <div className='feed__inputContainer'>
          <div className='feed__input'>
            <CreateIcon />
          </div>
        </div>
    </div>
  )
}

export default Feed
